import { createResponse, createErrorResponse } from "../../../utils/httpBuilderResponse"
import contryRepository from '../../../repository/country'


export default async (req, res) => {
    try {        

        const countries = await contryRepository().find()

        createResponse(res, {
            countries,
        })
    } catch(err) {
        console.log('err', err)
        createErrorResponse(res)
    }

}
